# De S a Infectado con síntomas o sin síntomas:
def beta(u, info):
    for i in range(0, len(info)):
        if(u == info[i][0]):
            proteccion = info[i][2]
            if(proteccion == 'V'):
                y = beta_1*(1 - tasa_vacunacion)
                # beta_1 -> probabilidad de que se infecte sin haber sido vacunado
                # (1 - tasa_vacunacion) -> probabilidad de que la vacuna no proteja
                # Su producto nos dará la probabilidad de que se mantenga siendo susceptible tras haber sido vacunado

            # elif(proteccion == 'A'):
            #    y = beta_1*(1 - tasa_anticuerpo)
            else:
                y = beta_1
    return y

# De I a R:
def gamma(u, info):
    for i in range(0, len(info)):
        proteccion = info[i][2]
        if(u == info[i][0]):
            if(proteccion == 'V'):
                y = 1 - (1 - gamma_1)*(1 - tasa_vacunacion)
                # (1 - gamma_1) -> probabilidad de que se recupere estando infectado con síntomas sin haber sido vacunado
                # (1 - tasa_vacunacion) -> probabilidad de que la vacuna no proteja
                # Su producto nos dará la probabilidad de que se mantenga infectado con síntomas tras haber sido vacunado
                # 1 - (1 - gamma_1)*(1 - tasa_vacunacion) -> probabilidad de que se recupere estando infectado con síntomas tras haber sido vacunado

            # elif(proteccion == 'A'):
            #    y = 1 - (1 - gamma_1)*(1 - tasa_anticuerpo)
            else:
                y = gamma_1
    return y

# De N a I:
def delta(u, info):
    for i in range(0, len(info)):
        proteccion = info[i][2]
        if(u == info[i][0]):
            if(proteccion == 'V'):
                y = delta_1*(1 - tasa_vacunacion)
                # delta_1 -> probabilidad de pasar a tener síntomas sin haber sido vacunado
                # (1 - tasa_vacunacion) -> probabilidad de que la vacuna no proteja
                # Su producto nos dará la probabilidad de pasar a tener síntomas tras haber sido vacunado

            # elif(proteccion == 'A'):
            #    y = delta_1*(1 - tasa_anticuerpo)
            else:
                y = delta_1
    return y

# De N a R:
def mu(u, info):
    for i in range(0, len(info)):
        proteccion = info[i][2]
        if(u == info[i][0]):
            if(proteccion == 'V'):
                y = 1 - (1 - mu_1)*(1 - tasa_vacunacion)
                # (1 - mu) -> probabilidad de no recuperarse manteniéndose en asintomático sin haber sido vacunado
                # (1 - tasa_vacunación) -> probabilidad de que la vacuna no proteja
                # Su producto nos dará la probabilidad de que se mantenga siendo asíntomático tras haber sido vacunado
                # 1 - (1 - mu_1)*(1 - tasa_vacunacion) -> probabilidad de que se recupere siendo asíntomático tras haber sido vacunado

            # elif(proteccion == 'A'):
            #    y = 1 - (1 - mu_1)*(1 - tasa_anticuerpo)
            else:
                y = mu_1
                # mu_1 -> probabilidad de que se recupere siendo asíntomático sin haber sido vacunado
    return y


