def elementos_mas_grandes(lista):
    # Enumeramos el array para tener acceso tanto al valor como al índice
    elementos_con_indices = list(enumerate(lista))

    # Ordenamos los elementos según su valor en orden descendente
    elementos_con_indices.sort(key=lambda x: x[1], reverse=True)

    # Tomamos los índices de los primeros 5 elementos del array ordenado
    posiciones = [indice for indice, _ in elementos_con_indices[:5]]

    return posiciones


