def contar_días_bloqueo(m,f,c): #f va a ser la fila y c la columna donde se encuentra el nodo bloqueado.
    # Nos interesa saber el número de días que va a estar bloqueado ese nodo si lo quitamos.
    # Entonces tenemos que guardarnos aquellas filas en las que aparece un 1 en su respectiva columna.
    
    # Se ha elegido el bloque del nodo que está en f y c.
    f_new = f
    filas = [f_new]
    bloqueo = m[f_new][c] # Estado de bloqueo en el que se encuntra el nodo
    condicion = True
    
    while(condicion): #En el momento que el bloqueo del siguiente tiempo sea 0 paramos.
        if(f_new+1 < len(m)): # Ponemos que sea menor que T, porque T es la numeración de la última fila para la matriz m
            if(m[f_new+1][c] == 0):
                condicion = False
            else:
                bloqueo = m[f_new+1][c]
                filas.append(f_new+1)
                f_new += 1
        else:
            condicion = False
    
    return filas

def matrices(m):
    nuevas_matrices = [m]
